var suggestions=document.getElementById('suggestions'),search=document.getElementById('search');search!==null&&document.addEventListener('keydown',inputFocus);function inputFocus(a){a.ctrlKey&&a.key==='/'&&(a.preventDefault(),search.focus()),a.key==='Escape'&&(search.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(c){const d=suggestions.classList.contains('d-none');if(d)return;const a=[...suggestions.querySelectorAll('a')];if(a.length===0)return;const b=a.indexOf(document.activeElement);if(c.key==="ArrowUp"){c.preventDefault();const d=b>0?b-1:0;a[d].focus()}else if(c.key==="ArrowDown"){c.preventDefault();const d=b+1<a.length?b+1:b;a[d].focus()}}(function(){var a=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:'id',store:["href","title","description"],index:["title","description","content"]}});a.add({id:0,href:"/docs/vscode/%E6%91%B8%E9%B1%BC%E7%A5%9E%E5%99%A8/",title:"摸鱼神器",description:"VSCode 扩展分享，VSCode 摸鱼神器",content:"本期推荐 VSCode 放（摸）松（🐟）神器，上班和学习一样，要劳逸结合的哦。\n小霸王 # 地址： https://marketplace.visualstudio.com/items?itemName=gamedilong.anes\n小霸王是一款基于vscode的nes游戏插件，能让你在紧张的开发之余在vscode里放松身心。选择想要玩的游戏，右键菜单下载。下载完成后，会加载到local菜单。点击即可完。 小霸王\u0026mdash;\u0026ndash;其乐无穷！！！但要记得戴耳机或者关闭外音哦！别问我是怎么知道的。。。\n韭菜盒子 # 地址： https://marketplace.visualstudio.com/items?itemName=giscafer.leek-fund\nVSCode 里也可以看股票 \u0026amp; 基金 \u0026amp; 期货实时数据，投资有风险，入市需谨慎！\n小欧并不建议初入股市的朋友打开实时查看，会三心二意的。\nCloudmusic # 网易云音乐插件，功能还蛮丰富的，直接登录账号即可，会同步歌单播客等信息，效果如图。（代码和音乐很配哦）\nz-reader # 地址： https://marketplace.visualstudio.com/items?itemName=aooiu.z-reader\n用来摸鱼或学习的小说阅读插件，支持在线搜索笔趣阁起点等，也支持本地阅读，支持 txt 和 epub 格式，效果如图。\nNBA real-time score # 地址： https://marketplace.visualstudio.com/items?itemName=liyangjj.NBARealTimeScore\n实时获取当天NBA比赛比分，并显示在vscode下方状态栏左侧；更可以观看实时文字直播，以及赛后数据统计。让你实现边 coding 边关注NBA。\n鼓励师系列 # 这个不过多介绍，可自行搜索。\n 本期主要介绍了几个延年益寿的插件，coding 之余也要放松哈，摸鱼不可耻，但要适当哈!\n"}),a.add({id:1,href:"/docs/vscode/%E6%95%88%E7%8E%87%E6%8F%90%E5%8D%87%E6%8F%92%E4%BB%B6%E6%8E%A8%E8%8D%90/",title:"效率提升插件推荐",description:"VSCode 扩展分享，VSCode 效率插件推荐",content:"本期给大家推荐几个通用型的插件，无关乎语言层面，希望能提升你的工作效率，增进你的视觉体验。\nvscode-icons # 地址： https://marketplace.visualstudio.com/items?itemName=vscode-icons-team.vscode-icons\n这个插件会根据文件后缀、名称显示不同的 icons，颜值颇高，设置后看着各种小图标心情舒畅，颜值党值得一试，如下图。（也可以自己设置喜欢的图标主题，扩展栏搜索 tag:icon-theme 安装你喜欢的即可）\nCode Runner # 地址: https://marketplace.visualstudio.com/items?itemName=formulahendry.code-runner\n这是小欧近期学习C++时发现的，可运行多种语言的代码片段，如 C, C++, Java, JavaScript, PHP, Python,, Go, Lua, Groovy, PowerShell, BAT/CMD, BASH/SH,, Visual Basic .NET, Clojure, Haxe, Objective-C, Rust, Racket, Scheme, AutoHotkey, AutoIt, Kotlin, Dart\u0026hellip;\u0026hellip;\n使用方法非常简单，光标在需要 debug 的文件中，然后 control+option+N，就可以 run code 啦！效果如图：（PS：你也可以自行定义命令。没错， \u0026ndash;std=c++11 就是小欧自定义的）\nProject Manager # 地址： https://marketplace.visualstudio.com/items?itemName=alefragnani.project-manager\n不知道大家在实际工作中，是否像小欧一样需要在多个项目间反复横跳。如果是这样，并觉得 VSCode 的下方历史项目操作起来略显繁琐，那么 project manager 绝对值得一试。\n安装完成后，左侧会有快捷选项卡，方便！！！可以点击上方修改图标自行配置，比如我的:​\n[ { \u0026quot;name\u0026quot;: \u0026quot;go-learning\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/go-learning\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;go-example\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/go-example\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;rust-learning\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/rust-learning\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;cpp-learning\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/cpp-learning\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;imgo\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/imgo\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true } ]  不仅如此，你还可以设置tag，方便不同标记查看。\nBetter Comments # 地址： https://marketplace.visualstudio.com/items?itemName=aaron-bond.better-comments\n又是颜值党的福音，美化注释直选，可以通过第一个字符区分不同的注释，当然也可以自定义，@和diy都是小欧自定义的，不同颜色也更方便区分不同级别的注释，好看又实用。\nTODO Tree # 地址： https://marketplace.visualstudio.com/items?itemName=Gruntfuggly.todo-tree\nTODO Tree 可以很方便地显示当前项目中所有的TODO所在的文件及位置，注意是大写的TODO哦，效果如图：（左侧也是有个选项卡快捷入口的）\nError Lens # 地址： https://marketplace.visualstudio.com/items?itemName=usernamehw.errorlens\nErrorLens 通过使诊断更加突出来增强语言诊断功能，在语言生成诊断的任何位置突出显示整行，并内联打印消息，效果如图。（PS：不得不说，可能对各种语言的支持并没有那么强大，有些提示并不精准，但无伤大雅）  本期主要就是推荐这几个好用美观的插件了，你有没有其他好用的插件推荐呢？不妨在评论区留下，分享给大家吧！\n"}),a.add({id:2,href:"/docs/vscode/git%E6%8F%92%E4%BB%B6/",title:"Git 插件",description:"VSCode 扩展分享，VSCode Git 插件",content:"Git 想必在大家伙的日常开发中是必不可少的，本期给大家推荐几个 git 相关插件，希望能提高你的开发效率。\ngitigone # 地址： https://marketplace.visualstudio.com/items?itemName=codezombiech.gitignore\n如果你觉得写 gitigone 是个烦人的事情，那么你可以试试，安装后command+shift+P打开，就贸易选择 add gitigone 了。\n选择后具体语言后就会生成gitignore 文件啦。 Git History # 地址： https://marketplace.visualstudio.com/items?itemName=donjayamanne.githistory\n在某个文件里直接点击右键，就可以查看当前你文件的 git 历史了，相当方便。\nGit Graph # 地址： https://marketplace.visualstudio.com/items?itemName=mhutchie.git-graph\n安装完成后左下角有快捷菜单，点击后看查看自己的 git 提交，如图：\n可点击查看单词 commit 的明细：\ngithub # 地址： https://marketplace.visualstudio.com/items?itemName=GitHub.vscode-pull-request-github\n这个算是针对 github 的扩展，可以快捷的插件 github PR，操作课件如下图。  我目前用到比较多的是 git history 和 git graph，像其他的 gitlens 等插件使用不多，就不推荐了。\n如果有其他 git 插件推荐，欢迎在评论区留言分享，感谢您的阅读。\n"}),a.add({id:3,href:"/docs/vscode/",title:"VSCode 扩展",description:"VSCode 扩展分享",content:"VSCode 是小欧目前正在使用的IDE，近几年使用人数增长很快。这些扩展是小欧工作中使用过的，分享给诸位，希望能给你提升一点效率。\n"}),a.add({id:4,href:"/docs/",title:"开源到",description:"开源到",content:""}),search.addEventListener('input',b,!0);function b(){var b,e;const d=5;b=this.value,e=a.search(b,{limit:d,enrich:!0});const c=new Map;for(const a of e.flatMap(a=>a.result)){if(c.has(a.doc.href))continue;c.set(a.doc.href,a.doc)}if(suggestions.innerHTML="",suggestions.classList.remove('d-none'),c.size===0&&b){const a=document.createElement('div');a.innerHTML=`No results for "<strong>${b}</strong>"`,a.classList.add("suggestion__no-results"),suggestions.appendChild(a);return}for(const[h,g]of c){const b=document.createElement('div');suggestions.appendChild(b);const a=document.createElement('a');a.href=h,b.appendChild(a);const e=document.createElement('span');e.textContent=g.title,e.classList.add("suggestion__title"),a.appendChild(e);const f=document.createElement('span');if(f.textContent=g.description,f.classList.add("suggestion__description"),a.appendChild(f),suggestions.appendChild(b),suggestions.childElementCount==d)break}}})()